import Link from 'next/link';

const Navbar = () => (
    <div>
        <ul>
            <li><Link href="/"><a>Home</a></Link></li>
            <li><Link href="/about"><a>About Us</a></Link></li>
        </ul>

        <style jsx>{`
            ul {
                background-color: #CCC;
            }
        `}</style>
    </div>
);

export default Navbar;
